import '../StyleCSS/Reviews.css';

function getRecentReviews(array) {
  return array.map((_, index) => (
    <div key={index} className="member-information-review__element">
      <div className="member-information-review-poster"></div>
      <div className="member-information-review-comment">
        This movie sucks big dodo ass like holy shit
      </div>
    </div>
  ));
}

function Reviews() {
  const dummyReviews = Array(5).fill({}); // Replace with actual reviews from props or state

  return (
    <div className="review-page">
      <div className="review-page-container">
        <div className="review-page-heading">Reviews of this person</div>

        <div className="member-information-review-container">
          {getRecentReviews(dummyReviews)}
        </div>
      </div>
    </div>
  );
}

export default Reviews;
